extern crate rand;
extern crate bn;
mod serialization;

use bn::*;
use self::serialization::*;

#[test]
fn serialization_and_deserialization() {
    let b = Fr::random(&mut rand::thread_rng());

    let mut a = G1::one();
    for _ in 0..100 {
        a = a * b;

        assert_eq!(reserialize(a), a);
    }

    let mut a = G2::one();
    for _ in 0..100 {
        a = a * b;

        assert_eq!(reserialize(a), a);
    }
}

#[test]
fn serialization_edge_cases() {
    assert_eq!(from_hex::<G1>("00").unwrap(), G1::zero());
    assert_eq!(from_hex::<G2>("00").unwrap(), G2::zero());
    assert!(from_hex::<G1>("23").is_none());
    assert!(from_hex::<G2>("23").is_none());

    // not points on the curve
    assert!(from_hex::<G1>("04177cedb64589bde7a64ad24f89bbb8c9f05535810865aaea8fbf8184ff9e120313500226b2422d2068614d1c8c7146c806a97743e78d9901748a9ded08ea9e5f").is_none());
    assert!(from_hex::<G2>("041800deef121b1e76426a00665e5c4479674322d4f75edadd46debd5cd992f6ed198e9393920d483a7260bfb731fb5d25f1aa493335a9e71297e485b7aef312c212c85ea5db8c6deb4aab71808dcb408fe3d1e7690c43d37b4ce6cc0166fa7daa090689d0585ff075ec9e99ad690c3395bc4b313370b38ef355acdadcd122975b").is_none());
}

